minge | Etymology, origin and meaning of minge
minge (n.) "female pudendum," 1903, unknown origin. Watkins suggests it is from Romany (Gypsy) mindž "vagina," which is possibly from Armenian mēǰ "middle, *medhyo- Proto-Indo-European root meaning "middle."
